import { Icon } from '@iconify/react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Icon icon="svg-spinners:wind-toy" color="#eb7ad8" width="275" />
          Welcome to Children Songs of the World!
      </header>
    </div>
  );
}

export default App;
